import { useState } from "react"
function getRandomAnimal() {
  const animals = ["🐶", "🐱", "🐭", "🐹", "🐰", "🦊", "🐻", "🐼", "🐨", "🐯", "🦁", "🐮", "🐷", "🐸", "🐵", "🐔", "🐧", "🐦", "🐤", "🐣", "🐥", "🦆", "🦅", "🦉", "🦇", "🐺", "🐗", "🐴", "🦄", "🐝", "🐛", "🦋", "🐌", "🐚", "🐞", "🐜", "🕷", "🕸", "🦂",]
}
function App(){
  const [count, setCount] = useState(0)

  const handleClick = () => {
    setCount(count + 1)
  }

  return(
    <div className="box">
      <button className="button is-primary" onClick={handleClick}>Add Animal</button>
      <p>Number of animals is : {count} </p>
    </div>
  )
}

export default App
